const About = () => {
    return (
        <section>
            <div className="container">
                <p clas>
                    / being a crypto degen is not a simple thing. We have a tons
                    of shitcoins,FOMOs,rugpulls and exploits. We need a safe
                    harbour...
                    <br />
                    <br />/ a few months ago, Coinbase, a web3 key to web2
                    world, pushed to public it’s own chain. What was the sense?
                    No sense for us until there are no native token $BASE.
                    That’s why we introduce $WEN. An experimental token on Base
                    with limited supply and some perks in the near future. Stay
                    tuned...
                </p>
            </div>
        </section>
    );
};

export default About;
